// Navbar.js

import React, { useState } from 'react';
import '../index.css'; // Import the CSS file

const Navbar = () => {
  const [activeLink, setActiveLink] = useState('home');

  const handleNavLinkClick = (link) => {
    setActiveLink(link);
  };

  return (

    <nav>
      <ul>
        <li>
          <a href="/" onClick={() => handleNavLinkClick('home')}>Home</a>
        </li>
        <li>
          <a href="/movies" onClick={() => handleNavLinkClick('about')}>About</a>
        </li>
        <li>
          <a href="/about" onClick={() => handleNavLinkClick('about')}>About</a>
        </li>
        <li>
          <a href="/contact" onClick={() => handleNavLinkClick('contact')}>Contact</a>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
